def get_sol(): return Solution()
class Solution:
    def smallestDistancePair(self, nums: List[int], k: int) -> int:
        def no_of_pair_with_at_most_d_diff(d):
            l,r=0,1
            res=0
            while r<n:
                while l<r and nums[r]-nums[l]>d:
                    l+=1
                res+=r-l
                r+=1
            return res

        n=len(nums)
        nums.sort()
        lo,hi=0,max(nums)
        while lo<=hi:
            d=(lo+hi)//2
            cnt=no_of_pair_with_at_most_d_diff(d)
            if cnt<k:
                lo=d+1
            else:
                hi=d-1
        return lo


